import React from 'react';
import Chip from '@material-ui/core/Chip';

const Style = {
    puces: {
        position: 'relative'
    }
};

function Chips(props) {
    return (
        <div className="puce">
            <Chip 
                label={props.name} 
                variant={props.type} 
                style={props.colorType} 
            />
        </div>
    );
}

export default Chips
